import React, {useEffect, useState} from "react";
import NavbarLoggedIN from "./NavBarLoggedIN";

const Home = () => {
    const [items, setItem] = useState(["NA"])
    useEffect(() => {
        const getItem = async () => {
            const res = await fetch("/userDetails");
            const getData = await res.json();
            const userData = Array.from(getData);
            setItem(getData);
            console.log(userData);
        }
        getItem();
        const getHealthItem = async () => {
            const ress = await fetch("/healthDetails");
            const getDataa = await ress.json();
            const userDataa = Array.from(getDataa);
            setItem(getDataa);
            console.log(userDataa);
        }
        getHealthItem();
    }, []);
    return (
        <div className='Home'>
            <NavbarLoggedIN/>
            {
                items.map((getItem) => (
                        <p>Email: {getItem.email}</p>
                    )
                )
            }
            {
                items.map((getHealthItems) => (
                        <p>Weight: {getHealthItems.weight}</p>
                    )
                )
            }
            {
                items.map((getHealthItems) => (
                        <p>Height: {getHealthItems.height}</p>
                    )
                )
            }
        </div>
    );
}

export default Home;
